import { Sidebar } from '../components/Sidebar'
import { Card } from '../components/Card'

export const Home = () => {
    const cards = [
        {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abb", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        }, {
            title: "abc", desc: "qwrqewer"
        },
    ]

    return (
        <div className="bg-[#E1E1E1] flex min-h-screen max-w-screen w-full h-full">
            <Sidebar />

            <div className=" w-4/5 flex flex-col space-y-4 ml-8 mr-8 mt-4"  >
            <div class="relative text-gray-600">
  <input class="w-full border-2 border-gray-300 bg-white h-10 px-5 pr-10 rounded-l-md text-sm focus:outline-none" type="search" name="search" placeholder="Pesquisar"/>
  <button type="submit" class="absolute right-0 top-0 rounded-r-md bg-gray-200 hover:bg-gray-300 focus:outline-none">
    <svg class="text-gray-600 h-4 w-4 fill-current" viewBox="0 0 16 16" xmlns="http://www.w3.org/2000/svg">
      <path d="M16 14.586L11.414 10H10.7l-.248-.24a6.2 6.2 0 1 0-.448.448l.24.248v.713l4.586 4.586L16 14.586zM6.2 10.2a4 4 0 1 1 5.657 0 4 4 0 0 1-5.657 0z" />
    </svg>
  </button>
</div>


            <p className='text-[#4A92FF] mb-2 pt-6 font-bold text-lg'>Trending Projects</p>
                {cards.map(item => {
                    return (
                        <Card title={item.title} desc={item.desc} 
                        />
                        
                    )
                })}
            </div>
        </div>
    )
}
